import React, { useRef, useEffect } from "react";

const Marquee = (props) => {
  return (
    <div className="marquee">
      <div className="container" style={{ display: "flex", width: '', justifyContent: 'space-evenly' }}>
        {new Array(8).fill(2).map((data, i) => (
          <div
          className="icon"
            style={{
              width: "60px",
              float: props.dir,
              aspectRatio: "1/1",
              display: "flex",
              alignItems: "center",
              justifyContent: 'center',
              border: "1px solid #023d65",
              borderRadius: "50%",
              marginLeft: '20px'
            }}
          >
            {i}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Marquee;
